import React from "react";
import Container from 'react-bootstrap/Container'
import {Row,Col} from 'react-bootstrap'
import "./AdminDashboard.css"

function AdminDashboard() {
    let testValue = false;
    function officerClick(e){
        e.preventDefault();
        console.log('officerClick was clicked');
    }
    function sponsorsClick(e){
        e.preventDefault();
        console.log('sponsorsClick was clicked');
    }
    function videosClick(e){
        e.preventDefault();
        console.log('videosClick was clicked');
    }
    return (
        <Container className = "AdminDashboard">
            <Row>
                <Col><a href = "#" onClick = {officerClick}>Officer</a></Col>
                <Col><a href = "#" onClick = {sponsorsClick}>Sponsors</a></Col>
                <Col><a href = "#" onClick = {videosClick}>Videos</a></Col>
            </Row>
        </Container>
    );
  }

  export default AdminDashboard;
